import logo from './logo.svg';
import './App.css';
import React from 'react';

function App() {

  const Button = ({style, text}) =>
  {
    return(
      <button type="button" className={style}>
        {text}
      </button>

    )
  }

  return (
    <div className="App">
      <header className="App-header">
          Grace Elias
      </header>
      <section className="button_container">
        <Button style = "home_button" text = "Home"> </Button>
        <Button style = "resume_button" text = "Resume"></Button>
        <Button style = "projects_button" text = "Projects">Test</Button>
        <Button style = "experience_button" text = "Experience">Test</Button>
        <Button style = "about_me_button" text = "About Me"></Button>
      </section>
    </div>

  );
}

export default App;
